import React from 'react';
import './Homepage.css'; // CSS dosyasını import ettik
import footballManagerLogo from './Statement_BH_3.png'; // Logo dosyasını buraya eklemelisiniz

const Homepage = () => {
  return (
    <div className="homepage-container">
      <div className="logo-container">
        <img src={footballManagerLogo} alt="Football Manager Logo" className="logo" />
      </div>
      <div className="buttons-container">
        {/* Sol butonlar */}
        <div className="left-buttons">
          <button className="button">Players</button>
          <button className="button">Wonderkids</button>
          <button className="button">Clubs</button>
        </div>

        {/* Sağ butonlar */}
        <div className="right-buttons">
          <button className="button">Comparison</button>
          <button className="button">Free Transfers</button>
          <button className="button">Log In</button>
        </div>
      </div>
    </div>
  );
};

export default Homepage;
